import React from 'react'

function Result(book, coverImageData) {
  console.log(book)
  console.log(coverImageData)
  return (
    <div><img src={`https://covers.openlibrary.org/b/id/${coverImageData.coverImageData}-L.jpg`}/><h4>{book.book.title}</h4><h5>{book.book.author_name}</h5></div>
  )
}

export default Result
